import React, { useEffect, useState } from 'react';
import axios from 'axios';

interface Person {
    name: string;
    // Добавьте другие поля, если они присутствуют в данных SWAPI
}
const App = () => {
    const [people, setPeople] = useState<Person[]>([]);

    useEffect(() => {
        const fetchData = async () => {
            try {
                const response = await axios.get('/api/swapi/');
                setPeople(response.data);
            } catch (error) {
                console.error(error);
            }
        };

        fetchData();
    }, []);

    return (
        <div>
            <h1>Star Wars Characters</h1>
            <ul>
                {people.map((person) => (
                    <li key={person.name}>{person.name}</li>
                ))}
            </ul>
        </div>
    );
};

export default App;
